import json
import pandas as pd
import numpy as np

def load_and_clean_climate_data(file_path):
    try:
        # Read the Excel file
        df = pd.read_excel(file_path)

        # Convert numeric columns to float, handling potential errors
        numeric_columns = ['Potassium']
        for col in numeric_columns:
            if col in df.columns:
                df[col] = pd.to_numeric(df[col], errors='coerce')

        # Convert time/date columns if present
        if 'Year' in df.columns:
            df['Year'] = pd.to_numeric(df['Year'], errors='coerce')

        return df
    except Exception as e:
        print(f"Error loading climate data: {str(e)}")
        return None

def load_and_clean_radiocarbon_data(file_path):
    try:
        # Read the Excel file
        df = pd.read_excel(file_path)

        # Convert date columns to numeric if present
        date_columns = ['Date']
        for col in date_columns:
            if col in df.columns:
                df[col] = pd.to_numeric(df[col], errors='coerce')

        return df
    except Exception as e:
        print(f"Error loading radiocarbon data: {str(e)}")
        return None

def linear_interpolate_potassium(df, start_year, end_year):
    # Ensure we're working with sorted data
    df = df.sort_values('Year')

    # Find the nearest values before and after our target years
    before_start = df[df['Year'] <= start_year].iloc[-1] if not df[df['Year'] <= start_year].empty else None
    after_start = df[df['Year'] >= start_year].iloc[0] if not df[df['Year'] >= start_year].empty else None
    before_end = df[df['Year'] <= end_year].iloc[-1] if not df[df['Year'] <= end_year].empty else None
    after_end = df[df['Year'] >= end_year].iloc[0] if not df[df['Year'] >= end_year].empty else None

    # Interpolate values
    if before_start is not None and after_start is not None:
        start_value = np.interp(start_year, 
                               [before_start['Year'], after_start['Year']], 
                               [before_start['Potassium'], after_start['Potassium']])
    else:
        return None

    if before_end is not None and after_end is not None:
        end_value = np.interp(end_year, 
                             [before_end['Year'], after_end['Year']], 
                             [before_end['Potassium'], after_end['Potassium']])
    else:
        return None

    return (start_value + end_value) / 2

# Main execution
climate_file = '/home/gridsan/elai/Kramabench/data/archeology/input/climateMeasurements.xlsx'
radiocarbon_file = '/home/gridsan/elai/Kramabench/data/archeology/input/radiocarbon_database_regional.xlsx'

# Load and clean data
climate_df = load_and_clean_climate_data(climate_file)
radiocarbon_df = load_and_clean_radiocarbon_data(radiocarbon_file)

results = {}

if climate_df is not None:
    results["subtask-1"] = "Successfully loaded climate data"
else:
    results["subtask-1"] = "Failed to load climate data"

if radiocarbon_df is not None:
    # Find first and last dates for Malta
    malta_data = radiocarbon_df[radiocarbon_df['Region'].str.contains('Malta', na=False)]
    if not malta_data.empty:
        first_date = malta_data['Date'].min()
        last_date = malta_data['Date'].max()
        results["subtask-2"] = {"first_date": float(first_date), "last_date": float(last_date)}

        # Calculate average Potassium
        avg_potassium = linear_interpolate_potassium(climate_df, first_date, last_date)
        results["subtask-3"] = {"potassium_values_found": avg_potassium is not None}

        if avg_potassium is not None:
            results["subtask-4"] = {"interpolated_average": avg_potassium}
            results["main-task"] = round(avg_potassium, 4)

# Print results
print(json.dumps(results, indent=4))

