    # Subtask 1: Load and check the structure of the Excel file
    try:
        df = pd.read_excel('/home/gridsan/elai/Kramabench/data/archeology/input/climateMeasurements.xlsx')
        subtask1_result = {"status": "success", "shape": df.shape, "columns": df.columns.tolist()}
    except Exception as e:
        subtask1_result = {"status": "error", "message": str(e)}

    # Subtask 2: Extract the wet-dry index column and ensure it's numeric
    try:
        # Find the column containing 'wet' and 'dry' (case insensitive)
        wet_dry_col = [col for col in df.columns if 'wet' in col.lower() or 'dry' in col.lower()]
        if not wet_dry_col:
            raise ValueError("No wet-dry index column found")

        wet_dry_col = wet_dry_col[0]
        # Convert to numeric, coercing errors to NaN
        df[wet_dry_col] = pd.to_numeric(df[wet_dry_col], errors='coerce')
        subtask2_result = {"status": "success", "column_name": wet_dry_col}
    except Exception as e:
        subtask2_result = {"status": "error", "message": str(e)}

    # Subtask 3: Calculate year-over-year changes
    try:
        # Calculate the difference between consecutive values
        changes = df[wet_dry_col].diff()
        subtask3_result = {"status": "success", "number_of_changes": len(changes.dropna())}
    except Exception as e:
        subtask3_result = {"status": "error", "message": str(e)}

    # Subtask 4: Count increases and calculate percentage
    try:
        # Count positive changes
        num_increases = (changes > 0).sum()
        # Total number of changes (excluding the first row where diff is NaN)
        total_changes = len(changes.dropna())
        # Calculate percentage
        percentage = round((num_increases / total_changes) * 100, 2)
        subtask4_result = {"status": "success", "percentage": percentage}
    except Exception as e:
        subtask4_result = {"status": "error", "message": str(e)}

    # Print results
    print(json.dumps({
        "subtask-1": subtask1_result,
        "subtask-2": subtask2_result,
        "subtask-3": subtask3_result,
        "subtask-4": subtask4_result,
        "main-task": percentage
    }, indent=4))

    return percentage

# Execute the solution
solve_climate_measurements()

