df = pd.read_csv('/home/gridsan/elai/Kramabench/data/archeology/input/roman_cities.csv')

# Subtask 1: Clean and preprocess ranks
def clean_rank(rank):
    if pd.isna(rank):
        return None
    if isinstance(rank, str) and 'or' in rank:
        nums = [float(x) for x in rank.split(' or ')]
        return np.mean(nums)
    return float(rank)

df['numeric_rank'] = df['Barrington Atlas Rank'].apply(clean_rank)
print(json.dumps({"subtask-1": "Ranks cleaned and converted to numeric values"}, indent=4))

# Subtask 2: Extract unique modern cities
modern_cities = df[['Modern Toponym', 'Longitude (X)', 'Latitude (Y)']].drop_duplicates()
print(json.dumps({"subtask-2": f"Found {len(modern_cities)} unique modern cities"}, indent=4))

# Subtask 3 & 4: Find matching ancient cities and highest ranks
results = []

for _, modern_city in modern_cities.iterrows():
    if pd.isna(modern_city['Modern Toponym']) or modern_city['Modern Toponym'] == 'Unknown':
        continue

    # Calculate distances to all ancient cities
    distances = np.sqrt(
        (df['Longitude (X)'] - modern_city['Longitude (X)'])**2 +
        (df['Latitude (Y)'] - modern_city['Latitude (Y)'])**2
    )

    # Find matches within 0.1 degrees
