import pandas as pd
import numpy as np
from scipy import stats
import json

# Read the data
world_cities = pd.read_csv('worldcities.csv')
roman_cities = pd.read_csv('roman_cities.csv')

# Subtask 1: Clean and prepare rank data
def clean_rank(rank):
    if pd.isna(rank):
        return np.nan
    if isinstance(rank, str) and 'or' in rank:
        nums = [float(x.strip()) for x in rank.split('or')]
        return np.mean(nums)
    return float(rank)

roman_cities['clean_rank'] = roman_cities['Barrington Atlas Rank'].apply(clean_rank)

# Subtask 2: Filter modern cities
modern_cities = world_cities[world_cities['population'] >= 1000000].copy()

# Subtask 3: Match cities based on distance
def calculate_distance(lat1, lon1, lat2, lon2):
    return np.sqrt((lat1 - lat2)**2 + (lon1 - lon2)**2)

matches = []
for _, modern in modern_cities.iterrows():
    for _, ancient in roman_cities.iterrows():
        dist = calculate_distance(
            modern['lat'], modern['lng'],
            ancient['Latitude (Y)'], ancient['Longitude (X)']
        )
        if dist < 0.1:
            matches.append({
                'modern_city': modern['city'],
                'ancient_city': ancient['Ancient Toponym'],
                'population': modern['population'],
                'rank': ancient['clean_rank']
            })

# Convert matches to DataFrame and keep last match for each modern city
matched_df = pd.DataFrame(matches)
if not matched_df.empty:
    matched_df = matched_df.drop_duplicates(subset=['modern_city'], keep='last')

    # Subtask 4: Calculate correlation
    correlation = stats.pearsonr(
        matched_df['population'],
        matched_df['rank']
    )[0]

    # Round to 6 decimal places
    final_correlation = round(correlation, 6)
else:
    final_correlation = None

# Print results
results = {
    "subtask-1": f"Cleaned {len(roman_cities)} ancient city ranks",
    "subtask-2": f"Found {len(modern_cities)} cities with population >= 1M",
    "subtask-3": f"Matched {len(matched_df) if not matched_df.empty else 0} cities",
    "main-task": final_correlation
}

print(json.dumps(results, indent=4))

