import pandas as pd
import json

# Function to safely read files
def safe_read_file(file_path):
    try:
        if file_path.endswith('.csv'):
            return pd.read_csv(file_path)
        elif file_path.endswith('.xlsx'):
            return pd.read_excel(file_path)
    except Exception as e:
        print(f"Error reading {file_path}: {e}")
        return None

# Initialize answer dictionary
answers = {}

# Subtask 1: Files with modern country information
country_containing_files = []

# Check worldcities.csv
worldcities_df = safe_read_file('worldcities.csv')
if worldcities_df is not None and 'country' in worldcities_df.columns:
    country_containing_files.append('worldcities.csv')

# Check roman_cities.csv
roman_cities_df = safe_read_file('roman_cities.csv')
if roman_cities_df is not None and 'Country' in roman_cities_df.columns:
    country_containing_files.append('roman_cities.csv')

answers["subtask-1"] = country_containing_files

# Subtask 2: Files with historical conflict information
conflict_containing_files = []

# Check conflict_brecke.csv
conflict_df = safe_read_file('conflict_brecke.csv')
if conflict_df is not None and 'Conflict' in conflict_df.columns:
    conflict_containing_files.append('conflict_brecke.csv')

answers["subtask-2"] = conflict_containing_files

# Main task answer: Combine the relevant files
answers["main-task"] = {
    "modern_country_files": country_containing_files,
    "historical_conflict_files": conflict_containing_files
}

# Print the results
print(json.dumps(answers, indent=4))
